import React from 'react'
import { Link } from 'react-router-dom'
export default function Navbar() {
    return (
        <div className="NavComtainer">
            <Link to ='/'>Home</Link>
            <Link to ='/admin'>Admin</Link>
            <Link to ='/logout'>Logout</Link>

        </div>
    )
}
